import Post from "./Post";
import './App.css';
import { Route, Routes } from "react-router-dom";
function App() {
  return (
    <Routes>

      <Route index element={

        <Post />

      } />
      <Route path={'/login'} element={

        <div>
          login
        </div>


      } />
    </Routes>
  );
}

export default App;
